import React from "react";
import "../components/HeroSection.css";
import PictureButton from "./PictureButton";

function HeroSection() {
  return (
    <div className="hero-container">
      <img src="/images/WeLoveThisPlace.jpg" alt="hero section" className="hero-image" />
      <div className="hero-textbox">
        <p className="hero-text">Because good neighbors don't just happen</p>
      </div>
      <div className="hero-buttons">
        <PictureButton title="Our Objectives" imageSrc="/images/RedForestLane.jpg" />
        <PictureButton title="Neighbour testimonials" imageSrc="/images/Neighbours.jpg" />
        <PictureButton title="Our Milestones" imageSrc="/images/RealRoad.jpg" />
      </div>
    </div>
  );
}

export default HeroSection;
